def increasingTriplet(nums):
    arr_size = len(nums)
    for j in range(arr_size):
        min_left = None
        max_right = None
        for i in range(j-1, -1, -1):
            if nums[i] < nums[j]:
                min_left = nums[i]
                break
        for k in range(j+1, arr_size, 1):
            if nums[k] > nums[j]:
                max_right = nums[k]
                break
        if min_left != None and max_right != None:
            if min_left < nums[j] and nums[j] < max_right:
                return True
            
    return False

def increasingTriplets1(nums):
    num_i = num_j = float('inf')
    for num in nums:
        if num <= num_i:
            num_i = num
        elif num <= num_j:
            num_j = num
        else:
            return True
    return False

